function check_if_this_is_correct () {
    if (controller.A.isPressed()) {
        if (set_level == 1) {
            if (mouse2.overlapsWith(Fall_tree)) {
                score()
            } else {
                no_score()
            }
        } else if (set_level == 2) {
            if (mouse2.overlapsWith(Spring_tree)) {
                score()
            } else {
                no_score()
            }
        } else if (set_level == 3) {
            if (mouse2.overlapsWith(Fall_tree)) {
                score()
            } else {
                no_score()
            }
        } else if (set_level == 4) {
            if (mouse2.overlapsWith(Winter_tree)) {
                score()
            } else {
                no_score()
            }
        } else if (set_level == 5) {
            if (mouse2.overlapsWith(Spring_tree)) {
                score()
            } else {
                no_score()
            }
        } else if (set_level == 6) {
            if (mouse2.overlapsWith(Summer_tree)) {
                score()
            } else {
                no_score()
            }
        } else {
            game.splash("" + info.score() + " new score!")
            game.over(true, effects.confetti)
        }
    } else {
    	
    }
}
