function score () {
    info.changeScoreBy(1)
    set_level += 1
    music.powerUp.play()
    mouse2.destroy()
    make_this_mouse()
}
function no_score () {
    music.powerDown.play()
    info.changeLifeBy(-1)
    mouse2.destroy()
    make_this_mouse()
}
